import styled from "styled-components";
import { useRef } from "react";

const Container = styled.div`
  height: 90px;
  color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  font-style: bold;
  font-size: 96px;
  font-weight: 500;
`;
const ref = useRef(null);
const Announcement = () => {
  return <Container ref={ref}>Shop</Container>;
};

export default Announcement;
